-- Mike Funiciello: 3 = ERR (Number of Re-Tries) INFO ABOVE IS AS OF 5/3/2013.

SELECT  *
FROM    UniTrac..REPORT_HISTORY
WHERE   STATUS_CD = 'PEND'
ORDER BY CREATE_DT ASC, REPORT_ID ASCSELECT  *
FROM    UniTrac..REPORT_HISTORY
WHERE   STATUS_CD = 'ERR'
        AND REPORT_ID IN (26,27)
        AND GENERATION_SOURCE_CD = 'U'
        AND CREATED_BY_TX = 'Cycle'
        AND UPDATE_DT > '2013-04-29'
        AND UPDATE_DT < '2013-04-30'       
ORDER BY CREATE_DT ASC------ Stacey Bevelhymer INC0105694-----
