--------------- Create a Dummy Document Container to Force Complete a Report ------------
-------- Insert ID from REPORT_HISTORY INTO SCRIPT BELOW
declare @ReportID as bigint
declare @DCID as bigint

set @ReportID = <REPORTID>

INSERT INTO [DOCUMENT_CONTAINER]
           ([DOCUMENT_MANAGEMENT_ID]
           ,[RELATIVE_PATH_TX]
           ,[ORIGINAL_FILE_NAME_TX]
           ,[ACTIVE_IN]
           ,[RELATE_CLASS_NAME_TX]
           ,[RELATE_ID]
           ,[CREATE_DT]
           ,[UPDATE_DT]
           ,[UPDATE_USER_TX]
           ,[LOCK_ID]
           ,[PRINT_STATUS_CD]
           )
     VALUES
           (4,
           'dummy'
           ,'dummy'
           ,'Y'
           ,'Allied.UniTrac.ReportHistory'
           ,@ReportID
           ,GETDATE(),
           GETDATE(),
           'admin'
           ,1
           ,'EXCLUDE'
           )

select @DCID = (select ID from DOCUMENT_CONTAINER where RELATE_ID = @ReportID and RELATE_CLASS_NAME_TX = 'Allied.UniTrac.ReportHistory')

update REPORT_HISTORY
set DOCUMENT_CONTAINER_ID = @DCID
where ID = @ReportID


SELECT * FROM UniTrac..REPORT_HISTORY
WHERE STATUS_CD = 'ERR'
AND CREATE_DT > '2015-04-15'

